  return (
    <div className="App">
      <div class="container">
        <h5>Reminder Pro</h5>
        <hr></hr>
        <form className="d-flex">
          <div className="col">
            <div className="mb-3">
              <label for="" className="form-label">Inline Form</label>
              <div className='d-flex flex-row gap-3'>
                <input name="" id="" className="form-control" placeholder="" aria-describedby="helpId" />
                <button type="button" name="" id="" className="btn btn-primary">Ekle!</button>
              </div>
              <small id="helpId" className="text-muted">Help text</small>
            </div>
          </div>
        </form>
      </div>
    </div>
  );
}

export default App;
